import "./App.css";
import React, { Component } from "react";
import Nav from "react-bootstrap/Nav";
import name from "./name.png";

export default class App extends Component {
  constructor(props) {
    super(props);
  }

  headerStyle = {
    display: "flex",
    justifyContent: "space-between"
  };

  navStyle = {
    display: "flex",
    gap: 15
  };

  navLinkStyle = {
    textDecoration: "none"
  };

  render() {
    return (
      <div className="App">
        <div style={this.headerStyle}>
          <a href="/" aria-current="page" aria-label="home">
            <img src={name} width="250" alt="" />
          </a>
          <Nav style={this.navStyle}>
            <Nav.Item>
              <Nav.Link href="#home" style={this.navLinkStyle}>
                My Work
              </Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="#link"  style={this.navLinkStyle}>About Me</Nav.Link>
            </Nav.Item>
          </Nav>
        </div>

        <div>
          <h1>
            Hola - I'm Caro Collazo :)
            <br />A creative...
          </h1>

          <div>
            <i>currently a software engineer @ Microsoft</i>
          </div>
        </div>
        <div>
          <div>Project</div>
          <div>Project</div>
          <div>Project</div>
          <div>Project</div>
        </div>
      </div>
    );
  }
}
